import React, { useEffect, useState } from 'react';
import axios from 'axios';

function sheet() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/api/sales') // Replace with your backend API URL
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <div>
      <h1>Sales Data</h1>
      <table>
        <thead>
          <tr>
            <th>Order Date</th>
            <th>Region</th>
            <th>Rep</th>
            <th>Item</th>
            <th>Units</th>
            <th>Unit Cost</th>
            <th>Total</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => (
            <tr key={item.id}>
              <td>{item.orderDate}</td>
              <td>{item.region}</td>
              <td>{item.rep}</td>
              <td>{item.item}</td>
              <td>{item.units}</td>
              <td>{item.unitCost}</td>
              <td>{item.total}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default sheet;
